import React from 'react'
import './App.css';
import NavBar from './Navigation/NavBar';
import Footer from './Navigation/Footer';
import Button from 'react-bootstrap/Button';

function App() {
  return (
    <div className="App">
      <NavBar/>
      <button type="button" class="btn btn-primary">Primary</button>
      <Footer/>
    </div>
  );
}

export default App;
